import { useEffect, useState } from "react";
import MenuItems from "./MenuItems";
import Shimmer from "./Shimmer";
import starLogo from "../../assets/star-svgrepo-com.svg";
import { useParams } from "react-router-dom";
import useRestaurantMenu from "../customHooks/useRestaurantMenu";
import useItemCard from "../customHooks/useItemCard";

const ResMenu = () => {
  const { resId } = useParams();
  const menuData = useRestaurantMenu(resId);
  const itemCards = useItemCard(menuData);
  // console.log('itemCard',itemCards);
  const {
    name,
    cuisines,
    areaName,
    sla,
    feeDetails,
    avgRating,
    totalRatingsString,
    costForTwoMessage,
  } = menuData?.cards[0]?.card?.card?.info || {};
  return menuData === null ? (
    <Shimmer />
  ) : (
    <div className="flex justify-center">
    <div className="menuPage w-[70%] lg:w-[50%] my-10">
      <div className="resMenu w-full flex flex-col">
        <div className="resDetails flex justify-between">
          <div className="left">
            <h1 className="font-bold py-2">{name}</h1>
            <p className="cuisines">{cuisines.join(", ")}</p>
            <p className="locations">
              {areaName}, {sla.lastMileTravelString}
            </p>
            <p className="feeDetails">{feeDetails.message}</p>
          </div>
          <div className="right border-solid border-gray-500 border-2 h-1/2 p-2">
            <p className="rate-up flex justify-center items-center border-solid border-gray-500 border-b-2">
              <img className="starlogo w-5" src={starLogo} alt="starlogo" />
              <p className="text-xl text-green-800 font-bold">{avgRating}</p>
            </p>
            <p className="rate-down">{totalRatingsString}</p>
          </div>
        </div>
        <div className="offers py-5 border-gray-500 border-y-2 my-5 border-dotted">
          <p>
            <strong>
              {sla.slaString} - {costForTwoMessage}
            </strong>
          </p>
        </div>
        <div className="menu">
          <div className="recommendedLength flex justify-between mb-5">
            <>
              <h4 className="font-bold">Recommended ({itemCards.length})</h4>
            </>
            <>
              <h4 className="font-bold">^</h4>
            </>
          </div>
          {itemCards.map((items) => {
            return <MenuItems key={items?.card?.info?.id} props={items} />;
          })}
        </div>
      </div>
    </div>
    </div>
  );
};

export default ResMenu;
